import logo from './logo.svg';
import './App.css';
import React from 'react';

function Exemple() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

class Exo extends React.Component {
  constructor (props) {
    super(props);
  }

  new_box(name) {
    const style = {
      width : 1
    };
    const box =
    <div className="box"><p className="box-text">{name}<input></input></p></div>;
    return box;
  }

  create_button(name) {
    const new_button =
      <button className="box">
        {name}
      </button>;
    return new_button;
  }

  Header() {
    return (
      <div className="header">
        <h1>Exercice entretien de stage</h1>
        <button className="add"
        onClick={() => this.create_button("Object :")}
        >Ajouter un objet</button>
        <button className="add"
        onClick={() => this.create_button("Utilisateur :")}
        >Ajouter un utilisateur</button>
        <p className="list">Liste :</p>
        {this.new_box("Object :")}
      </div>
    );
  }
}

function App() {
  var func = new Exo();
  return func.Header();
}

export default App;
